import React from 'react'
import { Link } from 'react-router-dom';

function Footer() {
    const styles ={
        footer:{
            backgroundColor: "#333",
            color: 'white',
            textAlign: 'center',
            padding: '10px',
            position: 'fixed',
            bottom: '0',
            width: '100%'
        },
        footerATag:{
            color: 'white',
            textDecoration: "none",
            margin: '10px'
        }
    }
  return (
    <footer style={styles.footer}>
        &copy; 2023 User Management |
        <Link to="/" style={styles.footerATag}>Home</Link>
        <a href="#" style={styles.footerATag}>Home</a> |
        <a href="#" style={styles.footerATag}> About</a> |
        <a href="#" style={styles.footerATag}>Contact</a>
    </footer>
  )
}

export default Footer
